import React from "react"

import "./TimelineItem.css"

import WorkIcon from "mdi-react/WorkIcon"

function TimelineItem(props){
  // const skills = props.data.skills.map(function(skill){
  //   return <li key={skill}> {skill} </li>
  // });

    document.getElementById('test').style.backgroundColor = "red";

    return(
        <div className="timeline-item" id="test">
        <p className="timeline-time">{props.data.date}</p>
        <div className="timeline-content">
          <h2 className="timeline-title">{props.data.title}</h2>
          <h4 className="timeline-subtitle">{props.data.subtitle}</h4>
          <p>{props.data.text}</p>
          {/* <ul>
            {skills}
          </ul> */}
        </div>
      </div>
    )
}

export default TimelineItem
